import { useNavigate } from "react-router-dom";

export default function Home() {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gradient-to-r from-blue-400 to-indigo-600 flex flex-col items-center justify-center text-white">
      <h1 className="text-4xl font-bold mb-8 text-center drop-shadow-lg">Face Attendance System</h1>

      <div className="flex flex-col sm:flex-row gap-6">
        <button
          onClick={() => navigate("/register")}
          className="bg-white text-blue-600 font-semibold px-8 py-4 rounded-xl shadow-lg hover:bg-gray-100 transition transform hover:-translate-y-1"
        >
          Register User
        </button>

        <button
          onClick={() => navigate("/attendance")}
          className="bg-white text-blue-600 font-semibold px-8 py-4 rounded-xl shadow-lg hover:bg-gray-100 transition transform hover:-translate-y-1"
        >
          Mark Attendance
        </button>
      </div>
    </div>
  );
}
